CREATE DEFINER=`root`@`localhost` PROCEDURE `Sp_InsertarFechaRango`()
BEGIN

declare vFecha, vFechaIni, vFechaFin date;

set vFechaIni = (select convert(Min(FechaEjecutaInicio), date) from programacion
where Estado = 1);

set vFechaFin = (select convert(Max(FechaEjecutaFin), date) from programacion
where Estado = 1);



set vFecha = vFechaIni;

drop table if exists temp_Fechastables;


 CREATE TEMPORARY TABLE temp_Fechastables 
SELECT vFechaIni as Fecha, DAYOFWEEK(vFechaIni) as DiaSemana,
case when DAYOFWEEK(vFechaIni) = 1 then 
'DO'
when DAYOFWEEK(vFechaIni) = 2 then
'LU'
when DAYOFWEEK(vFechaIni) = 3 then
'MA'
when DAYOFWEEK(vFechaIni) = 4 then
'MI'
when DAYOFWEEK(vFechaIni) = 5 then
'JU'
