'VI'
when DAYOFWEEK(vFechaIni) = 7 then
'SA'
else
'N/A'
end as Abreviado,

case when DAYOFWEEK(vFechaIni) = 1 then 
'd'
when DAYOFWEEK(vFechaIni) = 2 then
'l'
when DAYOFWEEK(vFechaIni) = 3 then
'k'
when DAYOFWEEK(vFechaIni) = 4 then
'm'
when DAYOFWEEK(vFechaIni) = 5 then
'j'
when DAYOFWEEK(vFechaIni) = 6 then
'v'
when DAYOFWEEK(vFechaIni) = 7 then
's'
else
'N/A'
end as Literal,
DAYNAME(vFechaIni) as DiaNombre,
day(vFechaIni) as Dia,
month(vFechaIni) as Mes,
year(vFechaIni) as Anio;


WHILE ( vFecha <= vFechaFin)  DO

set vFecha = ADDDATE(vFecha, 1);

insert into temp_Fechastables
SELECT vFecha as Fecha, DAYOFWEEK(vFecha) as DiaSemana,
case when DAYOFWEEK(vFecha) = 1 then 
'DO'
when DAYOFWEEK(vFecha) = 2 then
'LU'
when DAYOFWEEK(vFecha) = 3 then
'MA'
when DAYOFWEEK(vFecha) = 4 then
'MI'
when DAYOFWEEK(vFecha) = 5 then
'JU'
when DAYOFWEEK(vFecha) = 6 then
'VI'
when DAYOFWEEK(vFecha) = 7 then
'SA'
else
'N/A'
end as Abreviado,

case when DAYOFWEEK(vFecha) = 1 then 
'd'
when DAYOFWEEK(vFecha) = 2 then
'l'
when DAYOFWEEK(vFecha) = 3 then
'k'
when DAYOFWEEK(vFecha) = 4 then
'm'
when DAYOFWEEK(vFecha) = 5 then
'j'
when DAYOFWEEK(vFecha) = 6 then
'v'
when DAYOFWEEK(vFecha) = 7 then
's'
else
'N/A'
end as Literal,
DAYNAME(vFecha) as DiaNombre,
day(vFecha) as Dia,
month(vFecha) as Mes,
year(vFecha) as Anio;
                        
END WHILE;


truncate table util_fechas_activas;

insert into util_fechas_activas
select * from temp_Fechastables; 


END ;;
