CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_PaginarResultQuery`(vQuery text, vLimit INT, vPage INT)
BEGIN


SET @queryCount = CONCAT('SELECT COUNT(*) FROM ', SUBSTRING_INDEX(vQuery,'FROM',-1) );  

  SET @query = REPLACE(vQuery,'SELECT',CONCAT('SELECT (',@queryCount, ') AS CountRow, '));   
  
   IF (vLimit IS NOT NULL) THEN
    SET @query = CONCAT( @query, ' limit ', vLimit, ' offset ',  vPage);
  END IF;
  
  -- select @query;
   PREPARE stmt1 FROM @query;
   EXECUTE stmt1;

END ;;
