CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_PaginarResultTabla`(vTables varchar(250), vLimit INT, vPage INT, vCondicion varchar(500), vOrder varchar(500))
BEGIN

SET @queryCount = CONCAT('SELECT COUNT(*) FROM ', vTables);  

  SET @query = CONCAT(' FROM ', vTables);  

  IF (vCondicion IS NOT NULL) THEN
    SET @query = CONCAT(@query, ' WHERE ', vCondicion);
    
    SET @queryCount = CONCAT(@queryCount, ' WHERE ', vCondicion);  
  END IF;
  
  IF (vOrder IS NOT NULL) THEN
    SET @query = CONCAT(@query, ' order by ', vOrder);        
  END IF;
  
  
  IF (vLimit IS NOT NULL) THEN
    SET @query = CONCAT( @query, ' limit ', vLimit, ' offset ',  vPage);
  END IF;
  
  SET @query = CONCAT('SELECT (', @queryCount, ') AS CountRow, ', vTables, '.* ',  @query);  
  
  -- select @query;
   PREPARE stmt1 FROM @query;
   EXECUTE stmt1;
END ;;
DELIMITER ;
